import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { Navbar } from "./general/navbar/Navbar";
function App() {
  return (
    <Router>
      <Navbar/>
      <Routes>
                <Route exact path="/home" element={<Login/>} />
                </Routes>
    </Router>
  );
}

export default App;
